/** Removes the least scorer of the ScorerDocQueue in log(size) time.
 * Should not be used when the queue is empty.
 */
private final void popNoResult() {
  heap[1] = heap[size]; // move last to first
  heap[size] = null;
  size--;
  downHeap();	// adjust heap
}

